ished":{"testStepId":"e7aee98c-5187-4033-a414-ca51a68baa35","testCaseStartedId":"8c6535ed-c349-4cd2-91c3-e68c35ea8e20","testStepResult":{"status":"PASSED","duration":{"seconds":0,"nanos":17000000}},"timestamp":{"seconds":1718070673,"nanos":560000000}}},{"testCaseFinished":{"testCaseStartedId":"8c6535ed-c349-4cd2-91c3-e68c35ea8e20","timestamp":{"seconds":1718070673,"nanos":581000000},"willBeRetried":false}},{"source":{"data":"Feature: SmartBear Validation\n\n  Background:\n    Given user is on \"http://secure.smartbearsoftware.com/samples/testcomplete12/WebOrders/login.aspx\"\n\n\n  Scenario: Validate invalid login attempt\n    When user enters username as \"abcd\"\n    And user enters password as \"abcd1234\"\n    And user clicks on \"Login\" button\n    Then user should see \"Invalid Login or Password.\" message\n\n\n  Scenario: Validate valid login attempt\n    When user enters username as \"Tester\"\n    And user enters password as \"test\"\n    And user clicks on \"Login\" button\n    Then user should be routed to \"http://secure.smartbearsoftware.com/samples/testcomplete12/weborders/\"\n\n\n  Scenario: Validate Web Orders menu items\n    When user enters username as \"Tester\"\n    And user enters password as \"test\"\n    And user clicks on \"Login\" button\n    Then user should be routed to \"http://secure.smartbearsoftware.com/samples/testcomplete12/weborders/\"\n    And validate below menu items are displayed\n      | View all orders   |\n      | View all products |\n      | Order             |\n\n\n  Scenario: Validate \"Check All\" and \"Uncheck All\" links\n    When user enters username as \"Tester\"\n    And user enters password as \"test\"\n    And user clicks on \"Login\" button\n    Then user should be routed to \"http://secure.smartbearsoftware.com/samples/testcomplete12/weborders/\"\n    When user clicks on \"Check All\" button\n    Then all rows should be checked\n    When user clicks on \"Uncheck All\" button\n    Then all rows should be unchecked\n\n\n  Scenario: Validate \"Delete Selected\" button\n    When user enters username as \"Tester\"\n    And user enters password as \"test\"\n    And user clicks on \"Login\" button\n    Then user should be routed to \"http://secure.smartbearsoftware.com/samples/testcomplete12/weborders/\"\n    When user clicks on \"Check All\" button\n    And user clicks on \"Delete Selected\" button\n    Then validate all orders are deleted from the List of All Orders\n    And validate user sees \"List of orders is empty. In order to add new order use this link.\" message\n\n\n  Scenario: Validate adding new order\n    When user enters username as \"Tester\"\n    And user enters password as \"test\"\n    And user clicks on \"Login\" button\n    Then user should be routed to \"http://secure.smartbearsoftware.com/samples/testcomplete12/weborders/\"\n    When user clicks on \"Order\" menu item\n    And user enters all product information\n      | FamilyAlbum | 2 |\n    And user enters all address information\n      | John Doe | 123 Main St | Chicago | IL | 60000 |\n    And user enters all payment information\n      | Visa | 1234567812345678 | 12/34 |\n    And user clicks on \"Process\" button\n    And user clicks on \"View all orders\" menu item\n    Then validate all information entered displayed correct with the order\n    | John Doe | FamilyAlbum | 2 | 06/08/2024\t| 123 Main St | Chicago | IL | 60000 | Visa | 1234567812345678 | 12/34 |","uri":"cypress/features/smartBear.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"SmartBear Validation","description":"","children":[{"background":{"id":"2ef81f80-6d75-4236-a640-391a50256757","location":{"line":3,"column":3},"keyword":"Background","name":"","description":"","steps":[{"id":"59dc27eb-f97f-4184-8cf2-3d00b456f835","location":{"line":4,"column":5},"keyword":"Given ","keywordType":"Context","text":"user is on \"ht nteraction with TechGlobal HtmlElements page\n\n  Background:\n    Given user navigates to \"https://techglobal-training.com/frontend/\"\n    When user clicks on the \"Html Elements\" card\n    Then user should see the \"Html Elements\" page heading\n    Then the URL should contain \"elements\"\n\n  Scenario: Validate HTML elements card, Register and Sign in Buttons\n    When user clicks on the \"Register\" button\n    Then the text under it should be \"You clicked on “Register”\"\n    When user clicks on the \"Sign in\" button\n    Then the text under it should be \"You clicked on “Sign in”\"\n\n  Scenario: Validate HTML Elements card, Interact with text inputs - Choose options from the dropdown\n    When user selects \"Apple\" from the first dropdown menu\n    And user selects \"Microsoft\" from the second dropdown menu\n    Then \"Apple\" should be the selected option in the first dropdown\n    And \"Microsoft\" should be the selected option in the second dropdown\n\n  Scenario: Validate HTML Elements card, Interact with text inputs\n    When user enters \"test input\" to input field \"1\"\n    When user enters \"another test input\" to input field \"2\"\n    Then the text input \"1\" should contain \"test input\"\n    And the text input \"2\" should contain \"another test input\"\n\n  Scenario: Validate HTML Elements card, Toggle checkboxes and verify the state\n    When user selects the \"Microsoft\" checkbox\n    And user deselects the \"Microsoft\" checkbox\n    Then the \"Microsoft\" checkbox should not be checked\n    When user selects the \"Apple\" and \"Tesla\" checkboxes\n    Then both \"Apple\" and \"Tesla\" checkboxes should be checked\n    And the \"Microsoft\" checkbox remains unchecked","uri":"cypress/features/techglobal.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Interaction with TechGlobal HtmlElements page","description
